import React from "react";
import styled from "styled-components";
import Footer from "../Footer";
import Logo from "../../Images/Logo";

const Container = styled.div`
  background-color: #252525;
  width: 99vw;
  height: calc(100vh - 75px);
  text-align: center;
  margin: 0 auto;
  font-family: "Dolis", Arial, Helvetica, sans-serif;
  @media (max-width: 600px) {
    width: 100vw;
  }
`;

const OutlineBackgroundContainer = styled.div``;

const LoginBox = styled.div`
  width: 90vw;
  max-width: 600px;
  min-height: 375px;
  height: 50vh;
  max-height: 450px;
  margin: 0 auto;
  text-align: center;
  background-color: rgba(255, 255, 255, 0.8);
  border: 4px solid #fff;
  border-radius: 5px;
  position: absolute;
  top: 50vh;
  left: 50vw;
  transform: translate(-50%, -60%);

  @media (max-width: 600px) {
    margin-left: 7px;
  }
`;

const StyledLogo = styled(Logo)`
  width: 275px;
`;

const Login = () => {
  return (
    <div>
      <Container>
        <OutlineBackgroundContainer></OutlineBackgroundContainer>
        <LoginBox>
          <h1>Welcome To</h1>
          <StyledLogo />
          <form>
            <label>Login</label>
            <input placeholder="User Name" />
            <input placeholder="Password" />
            <button>Login</button>
            <br />
            <br />
            <a>Forgot Login</a>
            <a>Sign up</a>
          </form>
          <hr />
          <br />
          <form>
            <label>That's Okay, I Just Want to Roll Some Dice </label>
            <button>Dice Roller</button>
          </form>
        </LoginBox>
      </Container>
      <Footer />
    </div>
  );
};

export default Login;
